import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // --- Rapidly Add Items to Cart ---
    const initialCartText = await page.locator('div.cart').textContent();

    // Find all 'Add to Cart' buttons and click the first 4
    const addToCartButtons = await page.locator('button.add-to-cart').all();
    if (addToCartButtons.length < 4) {
      throw new Error('Could not find enough "Add to Cart" buttons for the test.');
    }

    // Click multiple buttons concurrently to stress the system
    await Promise.all([
      addToCartButtons[0].click(),
      addToCartButtons[1].click(),
      addToCartButtons[2].click(),
      addToCartButtons[3].click(),
    ]);

    // Wait for cart counter to update and verify
    await page.waitForFunction(() => document.querySelector('div.cart').innerText.includes('4'));
    const cartTextAfterAdd = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // --- Open Cart and Verify Items ---
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open_with_items.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open_with_items.png'));

    // --- Rapidly Remove Items from Cart ---
    const removeButtons = await page.locator('button.remove-item').all();
    // Click all remove buttons concurrently
    await Promise.all(removeButtons.map(button => button.click()));

    // Wait for the cart to show the empty message
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_emptied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_emptied.png'));

    // --- Close Cart and Final Verification ---
    // The script closes the modal on 'Escape' key press
    await page.keyboard.press('Escape');
    await page.waitForSelector('.cart-item', { state: 'hidden', timeout: 5000 });
    const finalCartText = await page.locator('div.cart').textContent();

    return {
      success: true,
      action: "Performed a rapid cart manipulation stress test by adding 4 items and then removing them all.",
      extractedData: {
        initialCartText: initialCartText.trim(),
        cartTextAfterAdd: cartTextAfterAdd.trim(),
        finalCartText: finalCartText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete the cart manipulation stress test.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
